import React from 'react';
import { useLocation } from 'react-router-dom';

const UserDashboard = () => {
    const location = useLocation();
    const user = location.state?.user; // Use optional chaining to avoid errors if state is undefined

    // Check if user data is available
    if (!user) {
        return <div>User information is not available. Please log in again.</div>;
    }

    return (
        <div style={{ padding: '20px' }}>
            <h2>Welcome, {user.user_profile?.name}</h2> {/* Optional chaining for user_profile */}
            <p><strong>Account Number:</strong> {user.account_number}</p>
            <p><strong>IFSC Code:</strong> {user.ifsc_code}</p>
            <p><strong>Location:</strong> {user.user_profile?.location}</p> {/* Optional chaining for user_profile */}

            <button style={buttonStyle}>Deposit</button>
            <button style={buttonStyle}>Withdraw</button>
            <button style={buttonStyle}>Inquiry</button>
        </div>
    );
};

const buttonStyle = {
    margin: '10px',
    padding: '10px',
    backgroundColor: '#000000',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
};

export default UserDashboard;
